import { exampleData } from "../../Data/list"
import { UpdateCIL } from "../updateCIL"

export function addData(props){
  const newBankBalance = 0

  if (props.state === "Einkommen") {newBankBalance = parseFloat(exampleData[exampleData.length-1].bankBalance) + newAmount}
  else {newBankBalance = parseFloat(exampleData[exampleData.length-1].bankBalance) - newAmount}

  var newData = {id: (exampleData.length), state:props.newState, 
                date: {day: props.newDay, month: props.newMonth, year: props.newYear}, amount: props.newAmount, bankBalance:newBankBalance}
  exampleData.push(newData)

  console.log("Added New Data.")
  console.log(newData)

  UpdateCIL()
}
